import React from 'react';
import './App.css';
import CalculatorForm from './components/CalculatorForm';

function App() {
  return (
    <div className="App">
      <header>
        <h1>Green Coders</h1>
      </header>
      <CalculatorForm />
    </div>
  );
}

export default App;
